--
-- Table structure for table `shipping_details`
--

DROP TABLE IF EXISTS `shipping_details`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `shipping_details` (
  `shipping_detail_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) unsigned NOT NULL,
  `shipping_provider` varchar(100) NOT NULL,
  `tracking_number` varchar(100) DEFAULT NULL,
  `external_order_id` varchar(100) DEFAULT NULL,
  `status` tinyint(4) NOT NULL,
  `shipping_fee` decimal(18,2) NOT NULL,
  `status_history` text DEFAULT NULL COMMENT 'JSON history from provider',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`shipping_detail_id`),
  UNIQUE KEY `shipping_details_order_id_unique` (`order_id`),
  KEY `shipping_details_tracking_number_index` (`tracking_number`),
  CONSTRAINT `shipping_details_order_id_foreign` FOREIGN KEY (`order_id`) REFERENCES `orders` (`order_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=272 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

